// client/src/services/apiService.ts
const API_BASE_URL = process.env.NODE_ENV === 'production' 
  ? 'https://your-production-api.com/api' 
  : 'http://localhost:3001/api';

class ApiService {
  private getAuthHeaders() {
    // ‚úÖ Fixed: Use 'auth_token' to match your registration form
    const token = localStorage.getItem('auth_token');
    return {
      'Content-Type': 'application/json',
      ...(token && { Authorization: `Bearer ${token}` })
    };
  }

  private async request<T>(endpoint: string, options: RequestInit = {}): Promise<T> {
    const url = `${API_BASE_URL}${endpoint}`;

    const config: RequestInit = {
      headers: this.getAuthHeaders(),
      ...options,
    };

    try {
      const response = await fetch(url, config);

      if (!response.ok) {
        const errorData = await response.json().catch(() => ({}));
        throw new Error(errorData.error || `HTTP error! status: ${response.status}`);
      }

      return await response.json();
    } catch (error) {
      console.error(`API Error (${endpoint}):`, error);
      throw error;
    }
  }

  // üîê AUTHENTICATION ENDPOINTS
  async registerClub(clubData: {
    name: string;
    email: string;
    password: string;
  }) {
    // ‚úÖ Fixed: Your backend returns direct response, not wrapped in { data: ... }
    return this.request<{
      message: string;
      token: string;
      user: {
        id: string;
        club_id: string;
        name: string;
        email: string;
        role: string;
      };
      club: {
        id: string;
        name: string;
        email: string;
      };
    }>('/clubs/register', {
      method: 'POST',
      body: JSON.stringify(clubData),
    });
  }

  async loginClub(credentials: { email: string; password: string }) {
    // ‚úÖ Fixed: Match actual backend response format
    return this.request<{
      message: string;
      token: string;
      user: {
        id: string;
        club_id: string;
        name: string;
        email: string;
        role: string;
      };
      club: {
        id: string;
        name: string;
        email: string;
      };
    }>('/clubs/login', {
      method: 'POST',
      body: JSON.stringify(credentials),
    });
  }

  async getCurrentUser() {
    return this.request<{
      user: any;
      club: any;
    }>('/clubs/me');
  }

  // üéØ CAMPAIGN ENDPOINTS
  async createCampaign(campaignData: {
    name: string;
    description?: string;
    target_amount: number;
  }) {
    return this.request<{ message: string; data: any }>('/campaigns', {
      method: 'POST',
      body: JSON.stringify(campaignData),
    });
  }

  async getClubCampaigns(clubId: string) {
    return this.request<{ message: string; data: any[] }>(`/clubs/${clubId}/campaigns`);
  }

  async getCampaignDetails(campaignId: string) {
    return this.request<{ message: string; data: any }>(`/campaigns/${campaignId}`);
  }

  async updateCampaign(campaignId: string, updates: any) {
    return this.request<{ message: string; data: any }>(`/campaigns/${campaignId}`, {
      method: 'PUT',
      body: JSON.stringify(updates),
    });
  }

  async deleteCampaign(campaignId: string) {
    return this.request<{ message: string }>(`/campaigns/${campaignId}`, {
      method: 'DELETE',
    });
  }

  // üìÖ EVENT ENDPOINTS
  async createEvent(eventData: {
    title: string;
    type: string;
    goal_amount: number;
    event_date: string;
    campaign_id?: string;
    venue?: string;
    max_participants?: number;
    description?: string;
  }) {
    return this.request<{ message: string; data: any }>('/events', {
      method: 'POST',
      body: JSON.stringify(eventData),
    });
  }

  async getClubEvents(clubId: string) {
    return this.request<{ message: string; data: any[] }>(`/clubs/${clubId}/events`);
  }

  async getUpcomingEvents(clubId: string) {
    return this.request<{ message: string; data: any[] }>(`/clubs/${clubId}/events/upcoming`);
  }

  async getEventDetails(eventId: string) {
    return this.request<{ message: string; data: any }>(`/events/${eventId}`);
  }

  async getEventFinancials(eventId: string) {
    return this.request<{ message: string; data: any }>(`/events/${eventId}/financials`);
  }

  async updateEvent(eventId: string, updates: any) {
    return this.request<{ message: string; data: any }>(`/events/${eventId}`, {
      method: 'PUT',
      body: JSON.stringify(updates),
    });
  }

  async deleteEvent(eventId: string) {
    return this.request<{ message: string }>(`/events/${eventId}`, {
      method: 'DELETE',
    });
  }

  // üí∞ EXPENSE ENDPOINTS
  async addEventExpense(eventId: string, expenseData: {
    category: string;
    description: string;
    amount: number;
    date: string;
    vendor?: string;
    payment_method?: string;
  }) {
    return this.request<{ message: string; data: any }>(`/events/${eventId}/expenses`, {
      method: 'POST',
      body: JSON.stringify(expenseData),
    });
  }

  async getEventExpenses(eventId: string) {
    return this.request<{ message: string; data: any[] }>(`/events/${eventId}/expenses`);
  }

  async addClubExpense(clubId: string, expenseData: any) {
    return this.request<{ message: string; data: any }>(`/clubs/${clubId}/expenses`, {
      method: 'POST',
      body: JSON.stringify(expenseData),
    });
  }

  async getClubExpenses(clubId: string) {
    return this.request<{ message: string; data: any[] }>(`/clubs/${clubId}/expenses`);
  }

  // üí∏ INCOME ENDPOINTS
  async addEventIncome(eventId: string, incomeData: {
    source: string;
    description: string;
    amount: number;
    date: string;
    payment_method?: string;
    reference?: string;
  }) {
    return this.request<{ message: string; data: any }>(`/events/${eventId}/income`, {
      method: 'POST',
      body: JSON.stringify(incomeData),
    });
  }

  async getEventIncome(eventId: string) {
    return this.request<{ message: string; data: any[] }>(`/events/${eventId}/income`);
  }

  // üìä FINANCIAL ENDPOINTS
  async getClubFinancials(clubId: string) {
    return this.request<{ message: string; data: any }>(`/clubs/${clubId}/financials`);
  }

  // üë• SUPPORTER ENDPOINTS
  async addSupporter(clubId: string, supporterData: {
    name: string;
    type: 'volunteer' | 'donor' | 'sponsor';
    contact_info: any;
    notes?: string;
  }) {
    return this.request<{ message: string; data: any }>(`/clubs/${clubId}/supporters`, {
      method: 'POST',
      body: JSON.stringify(supporterData),
    });
  }

  async getClubSupporters(clubId: string, filters?: {
    type?: string;
    limit?: number;
    offset?: number;
  }) {
    const queryParams = filters ? `?${new URLSearchParams(filters as any).toString()}` : '';
    return this.request<{ message: string; data: any[] }>(`/clubs/${clubId}/supporters${queryParams}`);
  }

  async getSupporterDetails(supporterId: string) {
    return this.request<{ message: string; data: any }>(`/supporters/${supporterId}`);
  }

  async updateSupporter(supporterId: string, updates: any) {
    return this.request<{ message: string; data: any }>(`/supporters/${supporterId}`, {
      method: 'PUT',
      body: JSON.stringify(updates),
    });
  }

  async deleteSupporter(supporterId: string) {
    return this.request<{ message: string }>(`/supporters/${supporterId}`, {
      method: 'DELETE',
    });
  }

  async getSupporterEngagement(supporterId: string) {
    return this.request<{ message: string; data: any }>(`/supporters/${supporterId}/engagement`);
  }
}

// Export singleton instance
export const apiService = new ApiService();
export default apiService;
